import Logo from "../assets/logo.png";

const Footer = () => {
  return (
    <div className="Footer">
        <div className="iconesfooter">
            <img src="https://i.goopics.net/5af8wi.png" c/>
            <img src="https://i.goopics.net/n7xqm1.png"/>
            <img src="https://i.goopics.net/krhrfe.png"/>
        </div>
      <img src="https://i.goopics.net/61x66n.jpg" className="imgfooter"></img>
      <div className="headerlogo">
        <img src={Logo} className="Logo"></img>
      </div>
    </div>
  );
};

export default Footer;
